        <Form.Check type={make} id={`Peugeot-${make}`} label={`Peugeot ${make}`} />
    </div>
  ))}
          </Form>
        </Modal.Body>
        <Modal.Footer>
          <Button variant="secondary" onClick={handleClose}>Next</Button>
        </Modal.Footer>
      </Modal>
    </>
  );
}

export default ManufacturerModal;
